import React, { useState, useEffect } from 'react';
import axios from 'axios';
import config from './config';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MapContainer, TileLayer, Polyline, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import './App.css';
import L from 'leaflet';

const App = () => {
  const [routes, setRoutes] = useState([]);
  const [changeRequests, setChangeRequests] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchAllRoutes();
    fetchChangeRequests();
  }, []);

  const fetchAllRoutes = async () => {
    try {
      setLoading(true);
      const response = await axios.get(`${config.backendUrl}/api/all_routes`);
      console.log("Fetched routes:", response.data);  // Debug log
      setRoutes(response.data);
      setLoading(false);
    } catch (error) {
      console.error("Error fetching all routes", error);
      setLoading(false);
    }
  };

  const fetchChangeRequests = async () => {
    try {
      const response = await axios.get(`${config.backendUrl}/api/change-requests`);
      setChangeRequests(response.data);
    } catch (error) {
      console.error("Error fetching change requests", error);
    }
  };

  const approveChangeRequest = async (requestId) => {
    try {
      const response = await axios.post(`${config.backendUrl}/api/approve-change-request`, {
        request_id: requestId
      });
      setChangeRequests(prevRequests => prevRequests.filter(request => request._id !== requestId));
      alert('Route change approved and sent to pilot.');
      // Optionally refresh routes to reflect the new route
      fetchAllRoutes();
    } catch (error) {
      console.error("Error approving change request", error);
    }
  };

  const createCustomMarkerIcon = () => {
    return new L.Icon({
      iconUrl: 'https://unpkg.com/leaflet@1.7.1/dist/images/marker-icon.png',
      iconSize: [25, 41],
      iconAnchor: [12, 41],
      popupAnchor: [1, -34],
      shadowUrl: 'https://unpkg.com/leaflet@1.7.1/dist/images/marker-shadow.png',
      shadowSize: [41, 41]
    });
  };

  return (
    <div className="container mt-4">
      <h1 className="text-center mb-4">ATC Interface</h1>
      <div className="card mb-4">
        <div className="card-body">
          <h2 className="card-title">All Flight Paths</h2>
          {loading && <p>Loading routes...</p>}
          <MapContainer center={[20, 0]} zoom={2} style={{ height: '600px' }}>
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            {routes.map((route, index) => (
              <Polyline
                key={index}
                positions={[
                  [route.source.lat, route.source.lon],
                  [route.destination.lat, route.destination.lon],
                ]}
                color="red"
              >
                <Marker position={[route.source.lat, route.source.lon]} icon={createCustomMarkerIcon()}>
                  <Popup>{route.source.name}</Popup>
                </Marker>
                <Marker position={[route.destination.lat, route.destination.lon]} icon={createCustomMarkerIcon()}>
                  <Popup>{route.destination.name}</Popup>
                </Marker>
              </Polyline>
            ))}
          </MapContainer>
        </div>
      </div>

      <div className="card mb-4">
        <div className="card-body">
          <h2 className="card-title">Change Route Requests</h2>
          {changeRequests.length > 0 ? (
            changeRequests.map((request, index) => (
              <div key={index} className="mb-2">
                <p><strong>Request ID:</strong> {request._id}</p>
                <p><strong>Current Coordinates:</strong> {request.current_coords.lat}, {request.current_coords.lon}</p>
                <p><strong>Destination Airport ID:</strong> {request.destination_airport_id}</p>
                <button
                  className="btn btn-success"
                  onClick={() => approveChangeRequest(request._id)}
                >
                  Approve Route Change
                </button>
              </div>
            ))
          ) : (
            <p>No change route requests.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default App;
